import React, { useState } from 'react';
import './mapa.css';

const MapSection = () => {
  const [selectedMachine, setSelectedMachine] = useState(null);

  const machines = [
    { id: 1, name: 'Cinta Caminadora 1', type: 'cardio', status: 'disponible', x: 10, y: 10 },
    { id: 2, name: 'Cinta Caminadora 2', type: 'cardio', status: 'ocupado', x: 10, y: 25 },
    { id: 3, name: 'El√≠ptica 1', type: 'cardio', status: 'disponible', x: 10, y: 40 },
    { id: 4, name: 'Bicicleta Est√°tica 1', type: 'cardio', status: 'disponible', x: 10, y: 55 },
    { id: 5, name: 'Press de Pecho', type: 'fuerza', status: 'mantenimiento', x: 40, y: 10 },
    { id: 6, name: 'Press de Piernas', type: 'fuerza', status: 'disponible', x: 40, y: 25 },
    { id: 7, name: 'Polea Alta', type: 'fuerza', status: 'ocupado', x: 40, y: 40 },
    { id: 8, name: 'Banco Inclinado', type: 'fuerza', status: 'disponible', x: 40, y: 55 },
    { id: 9, name: 'Mancuernas', type: 'peso_libre', status: 'disponible', x: 70, y: 10 },
    { id: 10, name: 'Barras Ol√≠mpicas', type: 'peso_libre', status: 'disponible', x: 70, y: 25 },
    { id: 11, name: 'Rack de Sentadillas', type: 'peso_libre', status: 'ocupado', x: 70, y: 40 },
    { id: 12, name: 'Zona de Estiramiento', type: 'funcional', status: 'disponible', x: 70, y: 55 }
  ];

  const getMachineIcon = (type) => {
    switch (type) {
      case 'cardio': return 'üèÉ';
      case 'fuerza': return 'üèãÔ∏è';
      case 'peso_libre': return 'üí™';
      case 'funcional': return 'ü§∏';
      default: return '‚ö°';
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'disponible': return '#10B981';
      case 'ocupado': return '#EF4444';
      case 'mantenimiento': return '#F59E0B';
      default: return '#6B7280';
    }
  };

  return (
    <div className="map-section">
      <div className="map-header">
        <h2>üó∫Ô∏è Mapa del Gimnasio</h2>
        <div className="legend">
          <div className="legend-item">
            <span className="status-indicator disponible"></span>
            <span>Disponible</span>
          </div>
          <div className="legend-item">
            <span className="status-indicator ocupado"></span>
            <span>Ocupado</span>
          </div>
          <div className="legend-item">
            <span className="status-indicator mantenimiento"></span>
            <span>Mantenimiento</span>
          </div>
        </div>
      </div>

      <div className="gym-map">
        <div className="gym-floor">
          {machines.map((machine) => (
            <div
              key={machine.id}
              className={`machine ${selectedMachine?.id === machine.id ? 'selected' : ''}`}
              style={{
                left: `${machine.x}%`,
                top: `${machine.y}%`,
                borderColor: getStatusColor(machine.status)
              }}
              onClick={() => setSelectedMachine(machine)}
              title={`${machine.name} - ${machine.status}`}
            >
              <span className="machine-icon">{getMachineIcon(machine.type)}</span>
              <div 
                className="machine-status"
                style={{ backgroundColor: getStatusColor(machine.status) }}
              ></div>
            </div>
          ))}
          
          {/* √Åreas del gimnasio */}
          <div className="gym-area cardio-area">
            <span className="area-label">Zona Cardio</span>
          </div>
          <div className="gym-area strength-area">
            <span className="area-label">Zona de Fuerza</span>
          </div>
          <div className="gym-area free-weights-area">
            <span className="area-label">Pesos Libres</span>
          </div>
        </div>
      </div>

      {selectedMachine && (
        <div className="machine-info">
          <h3>{selectedMachine.name}</h3>
          <div className="machine-details">
            <span className="machine-type">Tipo: {selectedMachine.type.replace('_', ' ')}</span>
            <span 
              className={`machine-status-text ${selectedMachine.status}`}
            >
              Estado: {selectedMachine.status}
            </span>
          </div>
          <button 
            className="reserve-btn"
            disabled={selectedMachine.status !== 'disponible'}
          >
            {selectedMachine.status === 'disponible' ? 'Reservar' : 'No Disponible'}
          </button>
        </div>
      )}
    </div>
  );
};

export default MapSection;
